import React from 'react';

const Nav = () => {
    return (
        <React.Fragment>
            <nav className='nav'>
                <a href="#">Profile</a> -
                <a href="#">Messages</a> -
                <a href="#">Music</a> -
                <a href="#">Settings</a>
                HiperNav
            </nav> 
        </React.Fragment>
    );
}

export default Nav;
